content: ":,:Avia Jesosy Tompo\nFa miandry Anao \u2018zahay.\nEny, avy faingana Aho,\
  \ mahareta ianao.\nHoy Izay manambara: Ho avy Aho,\nHo sambatra izay manasa ny akanjony,\
  \ (in-3)\nEny, avy faingana Aho mba hamaliako\nNy olona rehetraaraka ny asany. (in-2):,:\n\
  Ny olona rehetra araka ny asany."
id: 153
key: G
title: AVIA JESOSY TOMPO
